original_question:
Pembetatu $ABC$ ni sawia, ambapo $AB=AC$ na urefu $AM=11.$ Fikiria kwamba kuna nukta $D$ kwenye $\overline{AM}$ na $AD=10$ na $\angle BDC=3\angle BAC.$ Tafuta pembeni ya pembetatu $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

